INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('권고', 'ADVC', 'ADVICE', '수식어', 'ㅇ리드타임에 의한 기본발주.  권고발주량=판매예측+(최소진열량 또는 안전재고량)-(현재고+차기입점-1일까지의 입점예정수량)           (최소진열량 또는 안전재고량 중 그 값이 큰 것을 기준으로 함) 판매예측 : 4주간 매출수량을 토대로 요일별 판매지수를 산출하여 앞으로 7일간의 매출수량에 대해 요일별 판매지수와 join하여 시스템에서 계산 안전재고량=일평균판매량*안전재고일수   안전재고일수 - (1Batch, DC: 1일), (2Batch, 직납: 1.3일)', '2012-07-05');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '권고', 'ADVC', 'ADVICE', '수식어', 'ㅇ리드타임에 의한 기본발주.  권고발주량=판매예측+(최소진열량 또는 안전재고량)-(현재고+차기입점-1일까지의 입점예정수량)           (최소진열량 또는 안전재고량 중 그 값이 큰 것을 기준으로 함) 판매예측 : 4주간 매출수량을 토대로 요일별 판매지수를 산출하여 앞으로 7일간의 매출수량에 대해 요일별 판매지수와 join하여 시스템에서 계산 안전재고량=일평균판매량*안전재고일수   안전재고일수 - (1Batch, DC: 1일), (2Batch, 직납: 1.3일)', '2012-07-05', '최초입력');
