INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('봉인', 'SEAL', 'SEAL', '수식어', '배송차량에 상품 상차 완료 후 점포까지 개방이나 하역없이 무사히 도착했는지 여부를 확인하기 위해 리프트 조작장비함 등에 설치됨. 봉인에는 고유번호가 부여되어 있으며, 해제시 복구가 불가능하여 무단 해제여부를 확인할 수 있음', '2012-08-02');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '봉인', 'SEAL', 'SEAL', '수식어', '배송차량에 상품 상차 완료 후 점포까지 개방이나 하역없이 무사히 도착했는지 여부를 확인하기 위해 리프트 조작장비함 등에 설치됨. 봉인에는 고유번호가 부여되어 있으며, 해제시 복구가 불가능하여 무단 해제여부를 확인할 수 있음', '2012-08-02', '최초입력');
