INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('상품', 'SKU', 'STOCK KEEPING UNIT', '수식어', '단품. 상품의 최소 단위. 그러나 재고관리 필요상 3~5개를 묶음으로 판매할 때는 그것을 최소 단위(unit)로 조절한다. 이것을 유니트 컨트롤(unit control)이라고 한다. 판매방식과 매장마다 무엇을 단위로 할 것인지 결정해야 한다.', '2012-06-19');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '상품', 'SKU', 'STOCK KEEPING UNIT', '수식어', '단품. 상품의 최소 단위. 그러나 재고관리 필요상 3~5개를 묶음으로 판매할 때는 그것을 최소 단위(unit)로 조절한다. 이것을 유니트 컨트롤(unit control)이라고 한다. 판매방식과 매장마다 무엇을 단위로 할 것인지 결정해야 한다.', '2012-06-19', '최초입력');
