INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('선수금', 'ADRC', 'ADVANCED RECEIVE', '수식어', '용역(用役)이나 상품의 대가를 분할하여 받기로 한 경우 먼저 수령하는 (일부 또는 전체) 금액. 회계상에  표시되는 선수금은 현금지불이 아닌, 상품이나 용역의 인도에 의해 이행되는 채무로써 유동부채이다. 배달 시스템에서는 상품을 주문 받고 미리 받은 금액을 의미하며, POS 결재 시점부터 상품의 인도 완료시점까지 POS결재 금액은 선수금으로 관리 되고, 협력회사와 이마트간 I/F를 통한 주문 상품의 배달완료처리에 의해 금액은 선수금에서 매출액으로 전환된다.', '2012-07-03');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '선수금', 'ADRC', 'ADVANCED RECEIVE', '수식어', '용역(用役)이나 상품의 대가를 분할하여 받기로 한 경우 먼저 수령하는 (일부 또는 전체) 금액. 회계상에  표시되는 선수금은 현금지불이 아닌, 상품이나 용역의 인도에 의해 이행되는 채무로써 유동부채이다. 배달 시스템에서는 상품을 주문 받고 미리 받은 금액을 의미하며, POS 결재 시점부터 상품의 인도 완료시점까지 POS결재 금액은 선수금으로 관리 되고, 협력회사와 이마트간 I/F를 통한 주문 상품의 배달완료처리에 의해 금액은 선수금에서 매출액으로 전환된다.', '2012-07-03', '최초입력');
