INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('송장', 'INVC', 'INVOICE', '수식어', '송장 또는 인보이스(invoice)는 매매계약의 조건을 정당하게 이행했다는 뜻을 판매측이 구매측에 전달하는 서류로 일반적으로 발송장이라 함. 여기에서는 용차 사용 시 용차에 상차된 상품정보 등을 기록, 관리하는 일지.', '2012-07-31');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '송장', 'INVC', 'INVOICE', '수식어', '송장 또는 인보이스(invoice)는 매매계약의 조건을 정당하게 이행했다는 뜻을 판매측이 구매측에 전달하는 서류로 일반적으로 발송장이라 함. 여기에서는 용차 사용 시 용차에 상차된 상품정보 등을 기록, 관리하는 일지.', '2012-07-31', '최초입력');
