INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('이씨밴', 'ECVAN', 'ELECTRONIC COMMERCE VALUE ADDED NETWORK', '수식어', 'Electronic Commerce Value Added Network(전자상거래 부가가치 통신망). 유통사와 협력회사 간의 거래에 필요한 여러 데이터를 상호교환할 수 있도록 지원해주며, 거래를 개선하기 위한 여러 가지 정보를 제공하는 서비스.   초기에 이마트의 지속적인 성장에 따라 부하가 발생하여 이마트 독자적인 EDI 서비스로 운영하게 된 것이 바로 ECVAN이다.  범용성이 있는 외부 EDI를 사용하다 할인점업무의 특성상 다양한 상품과 협력회사와의 정보공유에 중점을 두어 기존에는 처리가 불가능하던 대용량 정보의 일괄처리가 가능해짐에 따라 업무가 효율화되고, 정형화된 양식의 데이터를 이마트 및 협력회사가 공유하여 업무처리가 명확해졌다.', '2012-07-27');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '이씨밴', 'ECVAN', 'ELECTRONIC COMMERCE VALUE ADDED NETWORK', '수식어', 'Electronic Commerce Value Added Network(전자상거래 부가가치 통신망). 유통사와 협력회사 간의 거래에 필요한 여러 데이터를 상호교환할 수 있도록 지원해주며, 거래를 개선하기 위한 여러 가지 정보를 제공하는 서비스.   초기에 이마트의 지속적인 성장에 따라 부하가 발생하여 이마트 독자적인 EDI 서비스로 운영하게 된 것이 바로 ECVAN이다.  범용성이 있는 외부 EDI를 사용하다 할인점업무의 특성상 다양한 상품과 협력회사와의 정보공유에 중점을 두어 기존에는 처리가 불가능하던 대용량 정보의 일괄처리가 가능해짐에 따라 업무가 효율화되고, 정형화된 양식의 데이터를 이마트 및 협력회사가 공유하여 업무처리가 명확해졌다.', '2012-07-27', '최초입력');
