INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('직매입', 'DRCV', 'DIRECT RECEIVE', '수식어', '판매자가 직접 상품을 매입하여 판매자의 자산으로 관리하는 것 재고관리 관점에서 판매자 재고로 귀속되며, 원칙적으로 반품이 불가함 직매입 상품은 유통회사의 물건으로 상품 관리 및 재고 관리 모두 유통회사에서 한다. 좀더 자세히 보면 직매입에 의한 직영매장은 점포주명의, 납세자 명의, 점포 운영책임이 모두 할인점에 있으나 직매입은 유통회사가 상품의 납품업자에서 산후에 이를 다시 소비자에게 판매하는 것으로서, 상품의 소유권은 유통회사에 있는 것이다. 즉 직매입은 유통회사가 다른 공급업자한테 물건을 사고 유통회사가 직접 장사를 하는 것', '2012-07-27');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '직매입', 'DRCV', 'DIRECT RECEIVE', '수식어', '판매자가 직접 상품을 매입하여 판매자의 자산으로 관리하는 것 재고관리 관점에서 판매자 재고로 귀속되며, 원칙적으로 반품이 불가함 직매입 상품은 유통회사의 물건으로 상품 관리 및 재고 관리 모두 유통회사에서 한다. 좀더 자세히 보면 직매입에 의한 직영매장은 점포주명의, 납세자 명의, 점포 운영책임이 모두 할인점에 있으나 직매입은 유통회사가 상품의 납품업자에서 산후에 이를 다시 소비자에게 판매하는 것으로서, 상품의 소유권은 유통회사에 있는 것이다. 즉 직매입은 유통회사가 다른 공급업자한테 물건을 사고 유통회사가 직접 장사를 하는 것', '2012-07-27', '최초입력');
