INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('카드회사', 'CRCO', 'CARD-COMPANY', '수식어', '부피가 크고 꼬임이 적은 면 또는 혼방섬유로 만들 실  ex) 작업복, 가구용 의류 소재 - 소면사라고도 한다. 방적공정의 일부로서 소면공정 및 정소면 공정 등이 있는데 둘다 섬유를 빗질하여 가지런히 하여 짧은 섬유나 잡물 등을 제거하고 실을 뽑는데 카드사는 보통급의 원면을 사용하여 정소면 공정을 거치지 않은 것을 말한다. 따라서 코마사에 비해서 실의 표면이 매끈하지 못하며 광택도 코마사에 비하여 훨씬 떨어진다.', '2012-07-30');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '카드회사', 'CRCO', 'CARD-COMPANY', '수식어', '부피가 크고 꼬임이 적은 면 또는 혼방섬유로 만들 실  ex) 작업복, 가구용 의류 소재 - 소면사라고도 한다. 방적공정의 일부로서 소면공정 및 정소면 공정 등이 있는데 둘다 섬유를 빗질하여 가지런히 하여 짧은 섬유나 잡물 등을 제거하고 실을 뽑는데 카드사는 보통급의 원면을 사용하여 정소면 공정을 거치지 않은 것을 말한다. 따라서 코마사에 비해서 실의 표면이 매끈하지 못하며 광택도 코마사에 비하여 훨씬 떨어진다.', '2012-07-30', '최초입력');
