INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('피킹', 'PICKNG', 'PICKING', '수식어', '어떤 창고라든지 보관장소에서 점포별 발주 수량에 맞게 선별하여 출하가능하게 하는 행위. 고객의 주문에 따라 지정된 물품을 보관장소에서 찾아내어 각 배송처별로 분류하고 정리하는 작업을 오더피킹(order picking)이라고 부른다.', '2012-07-27');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '피킹', 'PICKNG', 'PICKING', '수식어', '어떤 창고라든지 보관장소에서 점포별 발주 수량에 맞게 선별하여 출하가능하게 하는 행위. 고객의 주문에 따라 지정된 물품을 보관장소에서 찾아내어 각 배송처별로 분류하고 정리하는 작업을 오더피킹(order picking)이라고 부른다.', '2012-07-27', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('하드택', 'HT', 'HARD TAG', '수식어', '분실도난방지택 관리, 업체에서 사서 달아서 옴 협력회사에 다시 돌려줘야 하므로 입출과 관리를 함 의류/패션/가전 등에 사용하며 수량은 POS 판매수량 또는 발주 LOT 단위 1 LOT = 1(입수량)', '2012-07-26');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '하드택', 'HT', 'HARD TAG', '수식어', '분실도난방지택 관리, 업체에서 사서 달아서 옴 협력회사에 다시 돌려줘야 하므로 입출과 관리를 함 의류/패션/가전 등에 사용하며 수량은 POS 판매수량 또는 발주 LOT 단위 1 LOT = 1(입수량)', '2012-07-26', '최초입력');
