INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('행사', 'EVENT', 'EVENT', '수식어', '어떤 한가지 목적을 위해 어떤 주체가 자료, 물자 등을 동원하여 특정한 기간, 장소 및 사전계획 하에 대상을 참여시켜 서로 만남과 접촉을 함으로써 직·간접적으로 감동을 체득케 하는 쌍방간의 의사전달 체계의 한 수단인 현장 커뮤니케이션 활동을 총칭하는 말.', '2012-06-21');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '행사', 'EVENT', 'EVENT', '수식어', '어떤 한가지 목적을 위해 어떤 주체가 자료, 물자 등을 동원하여 특정한 기간, 장소 및 사전계획 하에 대상을 참여시켜 서로 만남과 접촉을 함으로써 직·간접적으로 감동을 체득케 하는 쌍방간의 의사전달 체계의 한 수단인 현장 커뮤니케이션 활동을 총칭하는 말.', '2012-06-21', '최초입력');
