INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('회송', 'RTN', 'SENDING BACK', '수식어', '발주외 상품, 초과 상품 등 매입 처리가 불가능한 상품에 대해 해당업체로 돌려보내 주는 것을 회송이라고 하며 이런 상품을 회송상품이라고 함.', '2012-06-27');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '회송', 'RTN', 'SENDING BACK', '수식어', '발주외 상품, 초과 상품 등 매입 처리가 불가능한 상품에 대해 해당업체로 돌려보내 주는 것을 회송이라고 하며 이런 상품을 회송상품이라고 함.', '2012-06-27', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('ABC', 'ABC', 'ABC', '수식어', '전주/전월 실적→카테고리(소분류) 매출 분석의 등급별로 표현. ABC자료 기준', '2012-07-27');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  'ABC', 'ABC', 'ABC', '수식어', '전주/전월 실적→카테고리(소분류) 매출 분석의 등급별로 표현. ABC자료 기준', '2012-07-27', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('DAS', 'DAS', 'DIGITAL ASSORTING SYSTEM', '수식어', 'DAS는 Digital Assorting System. 디지털 분배시스템. 주문데이터를 기준으로 각 매장별로 상품을 분배해 주는 작업을 디지털 표시기에 의하여 자동적으로 처리해 주는 시스템. 냉장제품 및 고도의 신선도 유지를 필요로 하는 상품의 배분시 가장 좋은 시스템.   여주센터 오픈과 동시에 적용된 분배작업을 위한 물류지원시스템이다. 점포 단위별로 표시기가 설치되어 있으며 표시된 수량에 맞추어 협력회사는 분배작업을 진행 할 수 있다. TC 상품중 비소터 상품이 DAS 대상 상품이 될 수 있다.', '2012-07-27');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  'DAS', 'DAS', 'DIGITAL ASSORTING SYSTEM', '수식어', 'DAS는 Digital Assorting System. 디지털 분배시스템. 주문데이터를 기준으로 각 매장별로 상품을 분배해 주는 작업을 디지털 표시기에 의하여 자동적으로 처리해 주는 시스템. 냉장제품 및 고도의 신선도 유지를 필요로 하는 상품의 배분시 가장 좋은 시스템.   여주센터 오픈과 동시에 적용된 분배작업을 위한 물류지원시스템이다. 점포 단위별로 표시기가 설치되어 있으며 표시된 수량에 맞추어 협력회사는 분배작업을 진행 할 수 있다. TC 상품중 비소터 상품이 DAS 대상 상품이 될 수 있다.', '2012-07-27', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('DWH', 'DWH', 'DATA WAREHOUSE', '수식어', '회사가 더 나은 의사결정을 위해 축적한 방대한 양의 데이터를 더욱 효율적으로 분석하기 위하여 사용하는 Software와 Hardware의 집합체이다. 데이터 웨어하우징의 궁극적인 목적은 물리적으로 여러 곳에 분산되어 있는 데이터베이스 내에 존재하는 데이타들에 대하여 하나의 논리적인 뷰(view)를 창출하는 것', '2012-06-19');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  'DWH', 'DWH', 'DATA WAREHOUSE', '수식어', '회사가 더 나은 의사결정을 위해 축적한 방대한 양의 데이터를 더욱 효율적으로 분석하기 위하여 사용하는 Software와 Hardware의 집합체이다. 데이터 웨어하우징의 궁극적인 목적은 물리적으로 여러 곳에 분산되어 있는 데이터베이스 내에 존재하는 데이타들에 대하여 하나의 논리적인 뷰(view)를 창출하는 것', '2012-06-19', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('EDI', 'EDI', 'ELECTRONICS DATA INTERCHANGE', '수식어', '이메일 및 팩스와 더불어 전자상거래의 한 형태이며, 기업간 거래에 관한 데이터와 문서를 표준화하여 컴퓨터 통신망으로 거래 당사자가 직접 전송 및 수신하는 정보전달 시스템이다.  주문서, 납품서, 청구서 등 무역에 필요한 각종 서류를 표준화된 상거래서식 또는 공공서식을 통해 서로 합의된 전자신호로 바꾸어 컴퓨터 통신망을 이용하여 거래처에 전송한다.', '2012-06-19');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  'EDI', 'EDI', 'ELECTRONICS DATA INTERCHANGE', '수식어', '이메일 및 팩스와 더불어 전자상거래의 한 형태이며, 기업간 거래에 관한 데이터와 문서를 표준화하여 컴퓨터 통신망으로 거래 당사자가 직접 전송 및 수신하는 정보전달 시스템이다.  주문서, 납품서, 청구서 등 무역에 필요한 각종 서류를 표준화된 상거래서식 또는 공공서식을 통해 서로 합의된 전자신호로 바꾸어 컴퓨터 통신망을 이용하여 거래처에 전송한다.', '2012-06-19', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('ENDCAP', 'ENDCAP', 'END CAP', '수식어', '곤도라의 양쪽 끝부분을 말함.  일반 곤도라 보다 매출이 최소 3~5배가 높음.  E/C는 주력상품을 대량으로 쌓아두고 충동구매를 유발하는 것이 목적이다.', '2012-08-01');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  'ENDCAP', 'ENDCAP', 'END CAP', '수식어', '곤도라의 양쪽 끝부분을 말함.  일반 곤도라 보다 매출이 최소 3~5배가 높음.  E/C는 주력상품을 대량으로 쌓아두고 충동구매를 유발하는 것이 목적이다.', '2012-08-01', '최초입력');
