INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('FACE', 'FACE', 'FACE', '수식어', '고객이 보는 방향에서, 보이는 상품의 표면 매대에 상품이 진열되어 있는 공간', '2012-07-11');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  'FACE', 'FACE', 'FACE', '수식어', '고객이 보는 방향에서, 보이는 상품의 표면 매대에 상품이 진열되어 있는 공간', '2012-07-11', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('LOSS', 'LOSS', 'LOSS', '수식어', '불필요하게 된다, 손해를 본다는 의미의 용어. 어떠한 원인으로 로스가 발생했을 경우, 그 액수가본래 벌어들일 수 있는 매출에 대한 %를 로스율이라고 한다. 로스는 선도가 떨어지거나 유행에 뒤쳐져 팔리지 않는 폐기 로스와 가격인하했을 경우 생기는 가격인하 로스, 도난으로 생기는 도난로스가 주된 것이다. 특정 상품을 싸게 파는 것을 로스 리더라고 한다.', '2012-07-03');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  'LOSS', 'LOSS', 'LOSS', '수식어', '불필요하게 된다, 손해를 본다는 의미의 용어. 어떠한 원인으로 로스가 발생했을 경우, 그 액수가본래 벌어들일 수 있는 매출에 대한 %를 로스율이라고 한다. 로스는 선도가 떨어지거나 유행에 뒤쳐져 팔리지 않는 폐기 로스와 가격인하했을 경우 생기는 가격인하 로스, 도난으로 생기는 도난로스가 주된 것이다. 특정 상품을 싸게 파는 것을 로스 리더라고 한다.', '2012-07-03', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('LOT', 'LOT', 'LOT', '수식어', '1회에 생산되는 특정수의 제품단위. 일반적으로 한 덩어리라는 의미를 가지며, 경영학상 생산이 실시되는 단위의 수량이다. 생산이 한 개씩 실시되는 경우에는 로트의 문제는 발생하지 않는다. 한 개가 아닌 수개 또는 상당수량을 한 덩어리로 하여 생산하는 경우, 이 한 덩어리의 수량이 로트이다. 각 로트의 생산방식을 총칭하여 로트시스템 또는 로트생산방식이라고 한다. 생산관리상의 로트에는 생산로트(한 기간 내에 생산하는 생산량), 제작로트(오더로 제작하는 생산량), 작업로트(1회에 계속하여 작업하는 생산량)가 있으며 가공 •운반 •검사 •정체(停滯) •구매 •수납(受納) •지급(支給) 등의 로트가 있다. 로트생산은 연속성이 없으므로 흐름작업으로 행하여지는 연속생산과 구별된다.', '2012-06-19');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  'LOT', 'LOT', 'LOT', '수식어', '1회에 생산되는 특정수의 제품단위. 일반적으로 한 덩어리라는 의미를 가지며, 경영학상 생산이 실시되는 단위의 수량이다. 생산이 한 개씩 실시되는 경우에는 로트의 문제는 발생하지 않는다. 한 개가 아닌 수개 또는 상당수량을 한 덩어리로 하여 생산하는 경우, 이 한 덩어리의 수량이 로트이다. 각 로트의 생산방식을 총칭하여 로트시스템 또는 로트생산방식이라고 한다. 생산관리상의 로트에는 생산로트(한 기간 내에 생산하는 생산량), 제작로트(오더로 제작하는 생산량), 작업로트(1회에 계속하여 작업하는 생산량)가 있으며 가공 •운반 •검사 •정체(停滯) •구매 •수납(受納) •지급(支給) 등의 로트가 있다. 로트생산은 연속성이 없으므로 흐름작업으로 행하여지는 연속생산과 구별된다.', '2012-06-19', '최초입력');
