INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('RFID', 'RFID', 'RFID', '수식어', '사물에 전자 Tag를 부착, 무선 자동인식으로 사물의 정보를 파악/교환하는 기술임. 사물의 판별 및 위치 확인이 가능. 현재 모든 상품에 붙어 있는 바코드의 발전 형태로서 바코드에 비해 원거리에서 보다 많은 정보를(이미지 등) 단시간 내 인식함 ( RFID: 최대 27m, 바코드: 최대 0.5m ) 금속을 제외한 어떠한 장애물도 투과, 데이터를 읽을 수 있음. 물류상의 이점으로는 상품을 이동시킨 채 코드를 인식시킬 수 있기 때문에 처리속도가 올라가는 등의 메리트가 있으며, 항만에서 콘테이너 출하시의 정보전달 등에서 비약적인 시간단축효과가 증명되었다.', '2012-06-19');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  'RFID', 'RFID', 'RFID', '수식어', '사물에 전자 Tag를 부착, 무선 자동인식으로 사물의 정보를 파악/교환하는 기술임. 사물의 판별 및 위치 확인이 가능. 현재 모든 상품에 붙어 있는 바코드의 발전 형태로서 바코드에 비해 원거리에서 보다 많은 정보를(이미지 등) 단시간 내 인식함 ( RFID: 최대 27m, 바코드: 최대 0.5m ) 금속을 제외한 어떠한 장애물도 투과, 데이터를 읽을 수 있음. 물류상의 이점으로는 상품을 이동시킨 채 코드를 인식시킬 수 있기 때문에 처리속도가 올라가는 등의 메리트가 있으며, 항만에서 콘테이너 출하시의 정보전달 등에서 비약적인 시간단축효과가 증명되었다.', '2012-06-19', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('SE', 'SE', 'SALE ELDER', '수식어', '점포에서 사업자 등록을 하고 상품 판매를 하는 사업자로서 일정 기간 계약을 하고 매출액 중 계약된 비율만큼 수수료를 받는다.', '2012-06-21');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  'SE', 'SE', 'SALE ELDER', '수식어', '점포에서 사업자 등록을 하고 상품 판매를 하는 사업자로서 일정 기간 계약을 하고 매출액 중 계약된 비율만큼 수수료를 받는다.', '2012-06-21', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('TC', 'TC', 'TRANSFER CENTER', '수식어', '통과형센터를 말함. 주로 조달운송처가 빨리 다수의 출하처로 상품을 분류하여 배송업무를 실시하기 위해 설치한 창고. 점포에서 협력회사로 발주한 상품을 협력회사는 물류센타로 납품, 물류센타에서는 점별로 분류하여 즉시 점포로 납품하는 형태.', '2012-07-27');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  'TC', 'TC', 'TRANSFER CENTER', '수식어', '통과형센터를 말함. 주로 조달운송처가 빨리 다수의 출하처로 상품을 분류하여 배송업무를 실시하기 위해 설치한 창고. 점포에서 협력회사로 발주한 상품을 협력회사는 물류센타로 납품, 물류센타에서는 점별로 분류하여 즉시 점포로 납품하는 형태.', '2012-07-27', '최초입력');
