INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('이익', 'PROFIT', 'PROFIT', '수식어', "기업이 제공하는 상품·서비스의 경쟁력을 나타내는 지표라고 할 수 있다. 판매가격에서 매입가격을 뺀 다음 거기에서 다시 인건비 등 '영업비'를 감한 이익을 말한다. 이러한 매출이익의 판매가격에 대한 비율을 '마진율'이라고 한다.", '2012-08-01');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '이익', 'PROFIT', 'PROFIT', '수식어', "기업이 제공하는 상품·서비스의 경쟁력을 나타내는 지표라고 할 수 있다. 판매가격에서 매입가격을 뺀 다음 거기에서 다시 인건비 등 '영업비'를 감한 이익을 말한다. 이러한 매출이익의 판매가격에 대한 비율을 '마진율'이라고 한다.", '2012-08-01', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('스타일', 'STYLE', 'STYLE', '수식어', '스타일(Style)은 용모, 자태라는 뜻으로, 어떤 시기에 처음 만들어진 모드(mode)가 어느 특정장소나 그룹의 특징적 의복이 되어 유행패션으로 태어나고 그것이 대중에 보급되어 일반화될 경우 그 모드가 나타내고 있는 특징적 요소를 말한다. 이처럼 룩은 개략적인 이미지 또는 느낌의 특징을 포착한 개념적 용어인 점에 비해 스타일은 보다 구체적인 디자인의 특징을 가리킨다. 즉 디자인 요소가 모여 스타일을 만들어내고, 그 스타일이 모여 룩을 만들어내는 것이다. 개념적 측면에서 스타일이 단순한 제품의 외관인 반면, 디자인은 스타일 보다 광범위한 개념이다. 예를 들어 성능과의 관련성에서 볼때, 뛰어난 스타일은 사람의 흥미를 유발하지만 반드시 제품이 잘 기능하도록 하지는 않으며, 때때로 스타일로 인하여 성능이 저하되는 경우도 있다(침대가 외관이 뛰어나다고 하여 수면에 편리하지는 않는 것 처럼). 그러나 디자인은 성능과 직접적인 관련이 있다. 디자인은 외관과 함께 사용의 편리성, 안전성 그리고 생산과 유통의 단순성, 경제성을 고려해야한다.', '2012-06-19');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '스타일', 'STYLE', 'STYLE', '수식어', '스타일(Style)은 용모, 자태라는 뜻으로, 어떤 시기에 처음 만들어진 모드(mode)가 어느 특정장소나 그룹의 특징적 의복이 되어 유행패션으로 태어나고 그것이 대중에 보급되어 일반화될 경우 그 모드가 나타내고 있는 특징적 요소를 말한다. 이처럼 룩은 개략적인 이미지 또는 느낌의 특징을 포착한 개념적 용어인 점에 비해 스타일은 보다 구체적인 디자인의 특징을 가리킨다. 즉 디자인 요소가 모여 스타일을 만들어내고, 그 스타일이 모여 룩을 만들어내는 것이다. 개념적 측면에서 스타일이 단순한 제품의 외관인 반면, 디자인은 스타일 보다 광범위한 개념이다. 예를 들어 성능과의 관련성에서 볼때, 뛰어난 스타일은 사람의 흥미를 유발하지만 반드시 제품이 잘 기능하도록 하지는 않으며, 때때로 스타일로 인하여 성능이 저하되는 경우도 있다(침대가 외관이 뛰어나다고 하여 수면에 편리하지는 않는 것 처럼). 그러나 디자인은 성능과 직접적인 관련이 있다. 디자인은 외관과 함께 사용의 편리성, 안전성 그리고 생산과 유통의 단순성, 경제성을 고려해야한다.', '2012-06-19', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('선적', 'ONBD', 'ONBOARD', '수식어', '배에 짐을 싣는 것.  수출자는 무역계약 체결 후 수출물품 확보하여 계약상 선적조건에 따라 운송회사와 계약체결하고 선적하게 됨, 선적조건은 통상 분할선적,환적 허용 여부, 선적방법, 선적항과 도착항, 선적일자를 포함, 운송비용 부담자는 무역계약 체결시 채택한 정형조건에 따름', '2019-05-20');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '선적', 'ONBD', 'ONBOARD', '수식어', '배에 짐을 싣는 것.  수출자는 무역계약 체결 후 수출물품 확보하여 계약상 선적조건에 따라 운송회사와 계약체결하고 선적하게 됨, 선적조건은 통상 분할선적,환적 허용 여부, 선적방법, 선적항과 도착항, 선적일자를 포함, 운송비용 부담자는 무역계약 체결시 채택한 정형조건에 따름', '2019-05-20', '최초입력');
