INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('서비스', 'SVC', 'SERVICE', '수식어', '재화/용역 등의 제공을 말하며, 서비스의 품질 유지/향상을 위해 SERVICE LEVEL을 관리함', '2019-05-20');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  '서비스', 'SVC', 'SERVICE', '수식어', '재화/용역 등의 제공을 말하며, 서비스의 품질 유지/향상을 위해 SERVICE LEVEL을 관리함', '2019-05-20', '최초입력');
INSERT INTO WORD (NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE) VALUES('ESL', 'ESL', 'ELECTRONIC SHELF LABEL', '수식어', "ESL(전자가격표시기, Electronic Shelf Label)은 쉽게 풀어 '전자쇼카드'로서, 액정표시기로 현재 시스템 상의 매가를 표시하여 주는 장치. POS에서 바뀌는 상품의 가격정보를 실시간으로 바꾸어 줄 뿐만 아니라 단위당 가격, 세일가격, 정상가격, 상품진열 위치 표시, 통화, 포인트 정보, 진열수량 등 부가정보를 표시할 수 있고, 상품구매와 매장운영에 도움을 주는 상품 정보를 추가할 수도 있다.   ESL의 장점은 일반 매가변경, 일중 매가변경이 실시간 반영될 수 있어 쇼카드 교체 작업이 줄어들고, 가격 고지 오류가 감소하는 등의 효과를 얻을 수 있다. 2007년 12월부터 수서점에 시범운영중이다. (2010년 5월 현재)", '2019-05-20');	INSERT INTO WORDHISTORY (WORDSEQ, NAME, ABBREVIATION, FULLNAME, SORTATION, DEFINITION, WRITEDATE, WRITEID) VALUES((SELECT SEQ FROM WORD ORDER BY SEQ DESC LIMIT 0,1) ,  'ESL', 'ESL', 'ELECTRONIC SHELF LABEL', '수식어', "ESL(전자가격표시기, Electronic Shelf Label)은 쉽게 풀어 '전자쇼카드'로서, 액정표시기로 현재 시스템 상의 매가를 표시하여 주는 장치. POS에서 바뀌는 상품의 가격정보를 실시간으로 바꾸어 줄 뿐만 아니라 단위당 가격, 세일가격, 정상가격, 상품진열 위치 표시, 통화, 포인트 정보, 진열수량 등 부가정보를 표시할 수 있고, 상품구매와 매장운영에 도움을 주는 상품 정보를 추가할 수도 있다.   ESL의 장점은 일반 매가변경, 일중 매가변경이 실시간 반영될 수 있어 쇼카드 교체 작업이 줄어들고, 가격 고지 오류가 감소하는 등의 효과를 얻을 수 있다. 2007년 12월부터 수서점에 시범운영중이다. (2010년 5월 현재)", '2019-05-20', '최초입력');
